import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className='App'>
      <header>
        <div>Person Icon</div>
        <div>Record Icon</div>
        <div>Chat Icon</div>
      </header>
      <main>
        <div>Tap to Record</div>
        <div>Button Icon</div>
      </main>
    </div>
  );
}

export default App;
